import Table from 'react-bootstrap/Table';
import React from 'react';

// eslint-disable-next-line import/no-anonymous-default-export
export default (props) => {
  return (
    <Table striped bordered>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>URL</th>
        </tr>
      </thead>
      <tbody>
        {props.value.data.map((item, index) => (
          <tr key={index}>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.url}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
}
